import React from 'react'

const TrendingCoin = ({ coin }) => {
    return (
        <div className='bg-white p-5 rounded-lg flex flex-col border w-1/2'>
            <img className='w-16 my-4' src={coin.large} alt='logo'/>
            <div className='font-semibold text-lg'>{coin.name}</div>
        </div>
    )
}

const TrendingCoinList = ({ TrendingJSON }) => {
    var arrTrending = []
    TrendingJSON.forEach((coin) => {
        arrTrending.push(<TrendingCoin coin={coin} key={coin.id}/>)
    })
    return (
        <div>
            <div>Trending Coins</div>
            <div className='p-4 flex flex-wrap gap-x-4'>
                {arrTrending}
            </div>
        </div>
    )
}

const Home = ({ TrendingJSON }) => {
    return (
        <div className='h-screen'>
            <TrendingCoinList TrendingJSON={TrendingJSON}/>
        </div>
    )
}

export default Home
